import React from "react";
import { Link } from "react-router-dom";

export function SignUpPage() {

    return( 
        <nav>
            <button class>
                <div className="space-x-6">
                <Link
                    to="/sign_up"
                    className="text-lg font-medium hover:text-gray-300 transition duration-300"
                    >
                    Sign Up
                    </Link>
                </div>
            </button>
        </nav>
    );
}
